import React, { Component, Fragment } from "react";

class Sidebar extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  componentDidMount() {
    console.log("hi");
  }

  componentWillUnmount() {}

  render() {
    return <div>Sidebar</div>;
  }
}

export default Sidebar;
